import React from 'react';
import { NavContent } from './NavbarStyle';

const Nav = ({
    title,
}) => (
  <NavContent background="green">
    <NavContent.Brand href="#home">{title}</NavContent.Brand>
  </NavContent>
);

export default Nav;
